(30, 0, 'NEW PRICE-DECEMBER FREE - 2 BRD APARTMENT FOR RENT !', 'PARAMOUNT PROPERTIES', '&lt;span itemprop=&quot;description&quot;&gt;&lt;p&gt;&lt;b&gt;$949.00 PLUS HYDRO - AND THE MONTH OF DECEMBER FREE !!! &lt;br&gt;&lt;br&gt;** &lt;/b&gt;Price is negotiable **&lt;br&gt;&lt;br&gt;\r\n Skyway Homes is just a short walk to the St. Laurent Shopping Centre.&amp;nbsp; \r\nThere are schools, restaurants, parks, and an outdoor rink in the \r\nwinter, and many other stores in the area - ALL within walking \r\ndistance.&amp;nbsp; The Aviation Parkway is right in the neighbourhood for those \r\nwho want to walk their dogs or go for a jog, walk, or bike ride; \r\nadditionally, it provides quick access to the 417 East.&amp;nbsp; Our 2 bedroom \r\napartments have beautiful hardwood flooring and are freshly painted. We \r\noffer 24-Hour Emergency Maintenance Service and 24-Hour Security \r\nService!!&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Well-Maintained Site and Units&lt;/li&gt;&lt;li&gt;Family-Oriented Neighbourhood&lt;/li&gt;&lt;li&gt;Fridge and Stove Included&lt;/li&gt;&lt;li&gt;Beautiful Hardwood Flooring&lt;/li&gt;&lt;li&gt;Freshly Painted Units&lt;/li&gt;&lt;li&gt;Walking Distance to Schools, Grocery Stores, Shopping, and Restaurants&lt;/li&gt;&lt;li&gt;Daily Security Patrol&lt;/li&gt;&lt;li&gt;24 Hour On-Call Superintendent&lt;/li&gt;&lt;li&gt;Maintenance Staff and Office Staff available Monday through Friday, 8:30am to 5:00pm&lt;/li&gt;&lt;li&gt;3 level walk up&lt;/li&gt;&lt;li&gt;Custom blinds included&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Great Location to call home!&lt;/p&gt;&lt;/span&gt;', 'Canada', 'Ontario', 'Ottawa', 'K1K 0W5', '01/01/2016', '613-408-2421', 'skyway@paramountapts.com', '', '', '', '', '', '', '', '', '', '', '1', '2', '2.5', '', '', '2015-12-12 10:38:05', 'REAL ESTATE', 213, 25, 1, ' $949.00', 'offer', 1, 1, '', 0),
