(2, 1, 'Looking for job ', 'urgent', '', 'Hi I am looking for job I have a experience for interlocking,concrete,parging,stucco,waterproof,brick,painter,basement finish,underpining or labour lots of job I have a driver lincenc G if you need people call me pls thx<br>', 'Canada', 'Ontario', 'Ottawa', 'K2E 6J4', '', 'elena.johnson10@yahoo.com', '', '', '', 'lHs9sO$_27.JPG', '', 'high', 'top', 'home', 'sidebar', 'slider', '5', '8', '', '', '', '12/10/2015', '2015-11-09 22:48:40', '', 263, 40, 1, 0, 0),
(3, 1, 'LOOKING FOR CASH JOBS    ', 'urgent', '', 'My Experiences are as follows, Event SetUP/Tear Down, Painter, Wood Stainer, House Mover, Dish Washer, Cleaner, Loading and Unloading Trucks. And Every Other Type of General Labour Job There is. <br>', 'Canada', 'Ontario', 'Ottawa', 'K2E 6J4', '', 'elena.johnson10@yahoo.com', '', '', '', '6AmqFf$_273.JPG', '', 'high', 'top', 'home', 'sidebar', 'slider', '5', '8', '', '', '', '12/03/2015', '2015-11-09 22:55:18', '', 263, 33, 1, 0, 0),
(4, 1, ' Indian Cook   ', 'urgent', '', 'Hi I have an experience to make Indian Gujarati food and continental food like pav bhaji, burger, pizza,uttapa,bhel , panipuri, chhole bhature,panjabi sabji,paratha,dal fry,pulav,chinese,sandwiches and many more. To know more contact me. For that you have to give order one day before that which kind of food or item you want to eat.. I can only make dinner time food at 7.00 pm.<br>', 'Canada', 'Ontario', 'Ottawa', 'K2E 6J4', '', 'elena.johnson10@yahoo.com', '', '', '', 'YaJx8h2384390366_36889fd30b_b.jpg', '', 'high', 'top', 'home', 'sidebar', 'slider', '5', '8', '', '', '', '12/10/2015', '2015-11-09 23:02:13', '', 258, 50, 1, 0, 0);
